import React from 'react';
import ProjectList from '../Components/ProjectList';


import "../CSS/Projects.css";

function Projects() {

    const images = [calculator, chatApp, clipboardLanding, formValidation, fyloLanding, guessNumber, orderSummary, rockPaper, taskManager, testimonialGrid, toDoList, weatherApp];
    return (
        <div className="Projects">

            <div>

                <div>
                    {images.forEach((img)=>{
                        <ProjectList img={img} />
                    })}
                </div>
            </div>

        </div>
    )
};
export default Projects;
